css:
.regex-railroad-diagram {
  background: #ffffff;
  overflow-x: scroll;
}
.regex-railroad-diagram svg.railroad-diagram {
  stroke: #333333;
  fill: #ffffff;
}
.regex-railroad-diagram svg.railroad-diagram path {
  stroke-width: 2;
  fill: rgba(0, 0, 0, 0);
}
.regex-railroad-diagram svg.railroad-diagram text {
  font-size: 13px;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  stroke-width: 0;
  text-anchor: middle;
}
.regex-railroad-diagram svg.railroad-diagram text.label {
  text-anchor: start;
}
.regex-railroad-diagram svg.railroad-diagram text.comment {
  font-size: 13px;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  fill: #333333;
}
.regex-railroad-diagram svg.railroad-diagram rect {
  stroke-width: 3;
  stroke: #f4f4f4;
  fill: #333333;
}
.regex-railroad-diagram svg.railroad-diagram rect.group {
  fill: rgba(0, 0, 0, 0);
  stroke-dash-array: 10 5;
}
